corp-css.html.body:
Корпоративный стиль CSSСинтаксисПосле значения свойства обязательно ставится точка с запятой.

Для отступов внутри правил используются Tab. 

Шестнадцатеричное значение цвета сокращается, где невозможно пишется полностью из всех шести символов. 

Для записи используются строчные буквы. Например, #f5f5f5, #000.

Названия тегов и свойств в правилах пишутся строчными буквами.

Начальный ноль для значений сокращается (например, .5 вместо 0.5).

Во всех случаях в стилях используются двойные кавычки. 

В необязательных случаях кавычки не опускаются.

После двоеточия в правилах ставится один пробел top: 10px;. 

А перед двоеточием пробел не нужен.

После запятых внутри значений rgb(), rgba(), hsl(), hsla() или rect() пробелы ставятся !!! Это повышает удобочитаемость.   rgba(0, 0, 0, 0.8)

До и после комбинатора между селекторами (например, p > a, ul > li) ставится один пробел.
Каждое объявление в правиле пишется на новой строке.

Перед открывающейся фигурной скобкой пробел не ставится. 

После скобки запись идёт с новой строки:.selector{
    color: #f5f5f5;
}

Закрывающая фигурная скобка пишется на новой строке и без отступа.
Единицы измерения не пишутся, там где в них нет необходимости. Например, border: 0.
/* Хорошо */
.selector,
.selector-secondary,
.selector[type="text"] {
   padding: 15px;
   margin-bottom: 15px;
   background-color: rgba(0, 0, 0, 0.5);
   box-shadow: 0 1px 2px #ccc, inset 0 1px 0 #ff0000;
}

/* Плохо */
   .selector, .selector-secondary, .selector[type=text]{
       padding:15px;
       margin:0px 0px 15px;
       background-color:rgba(0,0,0,.5);
       box-shadow:0px 1px 2px #CCC,inset 0 1px 0 #FFFFFF}

ВалидностьCSS должен проходить проверку на валидность. Для проверки используется  современный валидатор css или Unicorn.
Невалидность которую дают сторонние плагины и скрипты можно не исправлять
Имена классов (Желательно использовать БЭМ методологию)Пишутся строчными буквами, дефис используется (но не camelCase). 

Дефисы служат разделителями во взаимосвязанных классах (например, .button и .button-danger).

Имена классов должны быть такими, чтобы по ним можно было быстро понять какому элементу страницы задан класс.

Избегайте сокращений (единственное исключение — .btn для кнопок), но не делайте их слишком длинными (более трёх слов).

Для написания классов используются английские слова и термины.

Транслитом названия классов и атрибутов не пишутся.
/* Хорошо */
.alert-danger { … }
.tweet .user-picture { … }
.button { … }
.layout-center { … }


/* Плохо */
.testElement { … }
.t { … }
.big_red_button { … }
.knopka { … }

Правило @importПравило @import работает медленнее, чем тег . 
В стилях @import не должен использоваться.
Варианты шрифтаАльтернативные варианты шрифта и тип семейства указываются в конце перечисления font-family. 

В случае использования нестандартных шрифтов альтернативный веб-безопасный шрифт и тип семейства указываются, чтобы в случае отсутствия нестандартного шрифта в системе, изменения внешнего вида страницы были минимальны. Альтернативный шрифт должен быть такого же типа, что и нестандартный. 

Порядок шрифтов следующий: нестандартный шрифт, веб-безопасный, тип шрифта    font-family: 'Open Sans', Arial, Helvetica, sans-serif;

Название шрифта написанного слитно(без пробелов) писать без кавычек, название разделенное пробелами брать в кавычки
Пример    font-family:  myriadpro-regular, sans-serif;
    font-family: 'myriadpro regular', sans-serif;

wordpress/wp-basic.html.body:
Основные требования WordpressВерстальщик должен приступать к работе над проектом только после инвестигейта имплементатора.В инвистегейте должны быть расписаны все элементы страниц (post, widtet-text и т.д.). Имплементатор должен стараться избегать использования специфических англоязычных сокращений или терминов, его инвистегейт должен быть понятен верстальщику не имеющему больших знаний в WP. Верстальщик в соответствии с инвистегейтом должен использовать подходящий html код для элементов/блоков/виджетов страницы.

CSS свойства элементов находящихся в контентной части (пост, список постов, форма комментариев, список комментариев и т.д.) нужно прописывать глобально, а CSS свойства внутренних элементов виджетов (списки, ссылки, параграфы, формы и т.д.) должны прописываться относительно виджета или сайдбара, в случае если эти стили отличаются.

Основные правила для виджетов:текстовый виджет — может содержать любой html код;

динамический виджет — это стандартный виджет из набора WP, его СОДЕРЖИМОЕ ИЗМЕНИТЬ НЕЛЬЗЯ;

все виджеты должны иметь одинаковую структуру.

Необходимо помнить что, в текстовые виджеты, блоки комментариев, формы и т.д. клиент или имплементатор могут добавить дополнительное содержимое (списки, параграфы и др.), при этом стили добавленных элементов должны наследоваться и соответствовать общему дизайну сайта.

При необходимости для глобальной стилизации под текущий дизайн можно использовать этот css reset.(General Reset) Но следует помнить, что этот ресет следует подключать/применять после основного ресета(EricMeyer CSS Reset, Normalize.css, ect.) 

Обратите внимание на области отмеченные в инвестигейте как контент страницы, для этих блоков должны быть как минимум заданы боковые падинги и вертикальный отступ.
Поскольку в этот блок могут быть помещены любое содержимое не только то что указано в дизайне, то задавать эти отступы для конкретных внутренних блоков НЕ ПРАВИЛЬНО.Так же для всех контентных блоков (сюда относяться и контент поста/статьи), должны быть прописаны стили для след тегов p, ul, ol, a и заголовков даже если их нет в дизайне этого конкретного блока (если только они не заданы болeе глобально):для h1-h6 – размер, толщина, цвет, семейство шрифта и margin;

для p – margin;

для ul, ol – margin, и стили для буллетов согласно дизайну или если нет дизайна выравниваем на свой вкус;

для a – цвет (если отличается от глобального).

wordpress/wp-css.html.body:
CSSЦель — сохранить единый стиль оформления для всего сайта.
Если потребуется изменить стиль для динамического содержимого — классы использовать нельзя, переопределять стили нужно только контекстно.
Например, необходимо изменить отступ для параграфа в списке комментариев. Т.к. список комментариев это нумерованный список с классом "commentlist" генерируемый WP, то:.commentlist p{
     margin: 0 0 4px;
}
Необходимо изменить стиль списка для виджета:div.sidebar .widget ul{
    //some style
}
Подобным образом поступаем и с остальными элементами.
Также следует принять во внимание ряд базовых CSS классов, которые нужно использовать в подходящих ситуациях.aligncenter { text-align: center;}
img.aligncenter {
   display: block;
   margin: 0 auto;
}
.alignleft {float: left;}
.alignright {float: right;}
.wp-caption {
    border: 1px solid #ddd;
    text-align: center;
    background-color: #f3f3f3;
    padding: 4px;
}
.wp-caption img {
    margin: 0;
    padding: 0;
    border: 0 none;
}
.wp-caption p.wp-caption-text {
    padding: 0 4px;
    margin: 0;
}
